def nested_loops_with_break_and_continue_and_not_in_operator(my_list):
    """
    Write a function that takes a list of integers as input and returns the list of integers that are greater than 10 and less than 20.
    The function should use nested loops with break and continue statements and the not in operator to solve the problem.
    """
    result = []
    for i in my_list:
        if i > 10 and i < 20:
            for j in my_list:
                if j > 10 and j < 20:
                    if j not in result:
                        result.append(j)
    return result
